import './App.css';
import Post from "./post"
import Header from "./header"
import * as React from "react";
import ReactDOM from 'react-dom/client';
import {Routes, Route} from "react-router-dom";


function App() {
  return (
    <Routes>
      <Route index element={
        <main>
        <Header />
        <Post />
        <Post />
        <Post />
        </main>
      } />
    <Route path={'/login'} element={
      <div> login </div>
    } />
    </Routes>
  );
}

export default App;
